import React from "react";

function Add(fnum, snum){
    return fnum+snum;
}
function Sub(fnum, snum){
    return fnum-snum;
}
function Div(fnum, snum){
    return fnum/snum;
}
function Mul(fnum,snum){
    return fnum*snum;
}
export {Add, Sub, Div, Mul};
